import React from 'react';

function TableNewSale({ products ,handleQuantityChange}) {
  return (
    <table>
      <thead>
        <tr>
          <th>Nombre de producto</th>
          <th>Marca</th>
          <th>Unidad</th>
          <th>Monto Unitario (S/.)</th>
          <th>Cantidad</th>
          <th>Monto Parcial (S/.)</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product, index) => (
          <tr key={index}>
            <td>{product.nombre}</td>
            <td>{product.marca.nombre}</td>
            <td>{product.unidad.nombre}</td>
            <td>{product.montoUnitario}</td>
            <td>
              <input 
                type="number" 
                value={product.cantidad} 
                min={product.unidad === 'Kg' ? 0.1 : 1}
                step={product.unidad === 'Kg' ? 0.1 : 1}
                onChange={(e) => handleQuantityChange(index, e.target.value)}
              />
            </td>
            <td>{(product.cantidad * product.montoUnitario).toFixed(2)}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default TableNewSale;
